import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import CodingInterface from './CodingInterface.jsx';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/coding-interface">Go to Coding Interface</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/coding-interface" element={<CodingInterface />} />
          {/* 他のルートもここに追加できます */}
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home Page</h2>;
}

export default App;
